import { Fragment } from 'react';
import AboutUs from './components/body/AboutUs';
import Works from './components/body/Works';
import Header from './components/header/Header';
import Comment from './components/body/Comment';

function App() {
  return (
    <Fragment >
      <Header />
      <AboutUs />
      <Works />
      <Comment />
    </Fragment>
  );
}

export default App;
